import "./home.css";
import { useEffect } from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import Sidebar from "../../components/sidebar/sidebar";
import Transactions from "../../components/transaction/transaction";
import InforBoard from "../../components/inforBoard/inforBoard";

const Home = ({ setAdmin }) => {
  useEffect(() => {}, []);
  return (
    <div className="container" style={{ maxWidth: "1500px" }}>
      <h1 className="admin-page">Admin page</h1>
      <div className="row ">
        <Sidebar setAdmin={setAdmin} />
        <div className="col-10 main">
          <InforBoard />
          <BrowserRouter>
            <Routes>
              <Route path="/home" element={<Transactions />} />
            </Routes>
          </BrowserRouter>
        </div>
      </div>
    </div>
  );
};

export default Home;
